import React from 'react';
import { Anchor, ConfigProvider } from 'antd';
import './header.css';

const { Link } = Anchor;

function AppHeader() {
  return (
    <ConfigProvider
      theme={{
        anchor: {

          colorText: '#d818ff', // Link metin rengi
          linkPaddingBlock: '8px', // Link dikey iç boşluğu
          linkPaddingInlineStart: '20px', // Link yatay iç boşluğu
        },
      }}
    >
      <div className="container-fluid">
        <div className="header">
          <div className="anchor-container">
            <Anchor targetOffset="65" className="ant-anchor-wrapper">
              <Link href="#banner" title="Home" />
              <Link href="#feature" title="Skills" />
              <Link href="#hero" title="Project" />
              <Link href="#contact" title="Contact" />
            </Anchor>
          </div>
        </div>
      </div>
    </ConfigProvider>
  );
}

export default AppHeader;
